  background-color: rgba(244, 244, 244, 1);
  padding: 20px 20px;
  display: flex;
`;

function Compare() {
  return (
    <ProductContent>
        <div className="compare-from">
            <InputForm></InputForm>
        </div>
    </ProductContent>
    
  )
}

export default Compare
